import React from 'react';
import classes from './css.modules/AddHistory.module.css'
import plus from '../assets/plus.png'

const AddHistory = () => {
    return (
        <div className={classes.moduleButton}>
            <img src={plus} alt=""/>
            <p>Добавить историю</p>
        </div>
    );
};

export default AddHistory;
